    data: |
      SELECT DISTINCT - - col0 * + ( col0 ) - col1 * cor0.col0 * col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q8664.out
    data: |
      -32384
      -4203
      -93440
